import React from 'react';
import PopupWithForm from "./PopupWithForm";

export default function PopupWithConfirm ({ cards, isOpen, onClose, onSubmit }) {
    function handleSubmit(e) {
        console.log(cards);
        e.preventDefault();
        onSubmit(cards);
    }

    return (
        <PopupWithForm
            title="Вы уверены?"
            name="delete"
            isOpen={isOpen}
            onClose={onClose}
        >
            <button className="popup__button popup__button_delete" type="submit" onClick={handleSubmit}>Да</button>
        </PopupWithForm>
    )
}
